import React from 'react'

const Pin = () => {

  const styles = {
    backgroundImage: `url(${process.env.PUBLIC_URL}/BG2.jpg)`,
    backgroundSize: "1120px",
    backgroundPosition: "250px",
    height: "648px", // Ubah tinggi (height) sesuai kebutuhan Anda
  };


  return (
   <body style={styles}>
    <div className='flex'>
      <div className='flex flex'>
      <div className='p-2'>
        <span className='font-bold text-3xl p-2   text-white'>Information</span>
      </div>
      </div>
    </div>
   </body>
  )
}

export default Pin
